const OutgoingMsg = ({msg, time}) => {

    return (
        <div class="msg_history">
        <div class="outgoing_msg">
          <div class="sent_msg">
            <p>{msg}</p>
            <span class="time_date">{time}</span>
          </div>
        </div>
        </div>
    );

}

export default OutgoingMsg;
